import axios from "axios";

const BASE_URL = 'http://localhost:3001/api/v1/';
const PEAKS = 'peaks';

export const getAllMountains = async () => {
    try {
        const response = await axios.get(BASE_URL + PEAKS);
        console.log('res', response);

    } catch (error) {
        console.error(error);
        throw error;
    }
}
